var module_102899887507=void document.querySelector(".tc-content").querySelectorAll("img").forEach((img=>{if(img.src.endsWith(".svg")){const xhr=new XMLHttpRequest;xhr.open("GET",img.src,!0),xhr.onload=()=>{const div=document.createElement("div");div.innerHTML=xhr.responseText;const svg=div.querySelector("svg");img.parentNode.replaceChild(svg,img)},xhr.send()}}));